import { Libc, isNully } from '@clockwork/common';
import { subLogger } from '@clockwork/logging';
import { Inject, getSelfProcessName } from '@clockwork/native';
import { Buffer } from 'buffer';
import * as pako from 'pako';

//base64 deflated elf files

const soFixer64 =
  '';

const soFixer32 =
  '';

const logger = subLogger('sodump');
const mutex_size = Process.pointerSize === 4 ? 24 : 40;
const mutex_addr = Memory.alloc(mutex_size);
mutex_addr.writeByteArray(new Array(mutex_size).fill(0));

const dumpedLibs = new Map();
Libc.pthread_mutex_init(mutex_addr, NULL);

let dlMain: NativeFunction<any, any> | null = null;
function dlsymSoFixer() {
  if (dlMain) return dlMain;
  const filesDir = `/data/data/${getSelfProcessName()}`;
  let path: string | null = null;
  switch (Process.arch) {
    case 'arm64':
      path = dropSoFixer(soFixer64, 'SoFixer64.so', filesDir);
      break;
    case 'arm':
      path = dropSoFixer(soFixer32, 'SoFixer32.so', filesDir);
      break;
  }
  if (path) {
    const handle = Libc.dlopen(Memory.allocUtf8String(path), 0x01002);
    const sym = Libc.dlsym(handle, Memory.allocUtf8String('_Z6dlMainPcS_S_'));
    dlMain = new NativeFunction(sym, 'int', ['pointer', 'pointer', 'pointer']);
  }
  return dlMain ?? null;
}

function dropSoFixer(rawtext: string, fileName: string, filesDir: string) {
  Libc.mkdir(Memory.allocUtf8String(filesDir), 0o755);
  const fullPath = `${filesDir}/${fileName}`;
  const sodata = Buffer.from(pako.inflate(Buffer.from(rawtext, 'base64')));
  //@ts-ignore
  const file = new File(fullPath, 'w');
  //@ts-ignore
  file.write(sodata);
  //@ts-ignore
  file.flush();
  //@ts-ignore
  file.close();
  Libc.chmod(Memory.allocUtf8String(fullPath), 0o755);
  return fullPath;
}

function filterSo({ name, path }: { name: string; path: string }): boolean {
  return (
    path.startsWith('/data/') &&
    name !== 'base.odex' &&
    name !== 'soFixerArm32.so' &&
    name !== 'soFixerArm64.so'
  );
}

function dumpLibInternal(name: string) {
  const libso = Process.findModuleByName(name);
  if (libso == null) {
    logger.error({ tag: 'dumplib' }, `Module ${name} not found`);
    return -1;
  }

  const procName = getSelfProcessName();
  const baseDir = `/data/data/${procName}`;

  const initialPath = `${name}_dump_${libso.base}.so`;
  const finalPath = `${name}_${libso.base}_${libso.size}.so`;
  const finalOut = `${baseDir}/${finalPath}`;

  const dumpedFile = dumpSoFile(libso.base, libso.size, initialPath, `${baseDir}/dumps`);
  logger.info({ tag: 'dumped' }, dumpedFile);

  try {
    dlMain?.(
      Memory.allocUtf8String(dumpedFile),
      Memory.allocUtf8String(`${libso.base}`),
      Memory.allocUtf8String(finalOut),
    );
    logger.info(`${finalOut} success !~`);
  } catch (error) {
    logger.error(`dlMain(): ${error}`);
  }
}

function dumpSoFile(ptr: NativePointer, size: number, fileName: string, dumpDir: string) {
  logger.info(
    { tag: 'dump' },
    `dd if=/proc/${Process.id}/mem of=/data/local/tmp/${fileName} skip=${Number(ptr)} bs=1 count=${size}`,
  );
  const outPath = `${dumpDir}/${fileName}`;
  Libc.mkdir(Memory.allocUtf8String(dumpDir), 0o755);
  if (!Memory.protect(ptr, size, 'rwx')) {
    if (!Memory.protect(ptr, size, 'r')) {
      const ranges = Process.getModuleByAddress(ptr).enumerateRanges('');
      for (const range of ranges) {
        Memory.protect(range.base, range.size, 'r');
      }
    }
  }
  const buffer = ptr.readByteArray(size);
  //@ts-ignore
  const file = new File(outPath, 'w');
  //@ts-ignore
  file.write(buffer);
  //@ts-ignore
  file.flush();
  //@ts-ignore
  file.close();
  return outPath;
}

function dumpFromMaps() {
  const modules = Process.enumerateModules();
  for (const { name, path } of modules) {
    if (filterSo({ name, path })) {
      if (!dumpedLibs.has(name)) {
        dumpLibInternal(name);
        dumpedLibs[name] = true;
      }
    }
  }
}

function initSoDump() {
  Inject.afterInitArrayModule(({ path, name }) => {
    if (filterSo({ name, path })) {
      logger.info(`path: ${path}, name: ${name}`);
      if (Libc.pthread_mutex_lock(mutex_addr) === 0x0) {
        try {
          if (!dumpedLibs.has(name)) {
            dumpLibInternal(name);
            dumpedLibs[name] = true;
          }
        } catch (error) {
          logger.error(`dlopen(): ${error}`);
        } finally {
          Libc.pthread_mutex_unlock(mutex_addr);
        }
      }
    } else if (name.includes('libc.so')) {
      if (Libc.pthread_mutex_lock(mutex_addr) === 0x0) {
        try {
          dumpFromMaps();
        } catch (error) {
          logger.error(`dumpFromMaps(): ${error}`);
        } finally {
          Libc.pthread_mutex_unlock(mutex_addr);
        }
      }
    }
  });
}

function dumpLib(name: string, sync = false) {
  if (!sync || Libc.pthread_mutex_lock(mutex_addr) === 0x0) {
    try {
      const dlMain: any = dlsymSoFixer();
      dlMain && dumpLibInternal(name);
    } catch (err) {
      logger.error(`dumpLib(sync=${sync}): ${err}`);
    } finally {
      sync && Libc.pthread_mutex_unlock(mutex_addr);
    }
  }
}

export { dlsymSoFixer, dumpLib, initSoDump };
